import org.apache.spark.sql._

def loadDF(path:String)={
    val df = spark.read.option("header","true").csv(s"${path}")
    df.cache
    df.printSchema
    println(df.count)
    println(df.first)
    df 
}

val reportBasePath = "s3://rea-consumer-data-qa/ben-kuai/seg-training/"

def loadReport(report:String)= loadDF(s"${reportBasePath}${report}/")

def joinDF(df1:DataFrame, df2:DataFrame, column:String)={
    val joinedDF = df1.join(df2, column)
    joinedDF.printSchema
    println(joinedDF.count)
    println(joinedDF.first)
    joinedDF
}

val labelDF = loadDF("s3://rea-consumer-data/ben-kuai/app_model_training.csv")

val seed = 888
val Array(trainDF, validationDF, testDF) = labelDF.randomSplit(Array(0.7, 0.25, 0.05), seed)

val outputBasePath = "s3://rea-consumer-data-qa/consumer-segmentation-generator/modeling/"



def exportDF(df:DataFrame, path:String)={
    df.write.option("header","true").csv(path)
}

def exportReportDF(df:DataFrame, path:String) = exportDF(df, s"${outputBasePath}${path}/")

def filterReport(report:String)={
    val reportVisitorIDHeader = "Visitor_ID"
    val newReportVisitorIDHeader = "report_visitor_id"
    val labelVisitorIDHeader = "visitor_id"
    val reportDF = loadReport(report)

    def joinAndExport(labelledDF: DataFrame, typ: String) = {
      val joinedBasicDF = joinDF(reportDF.withColumnRenamed(reportVisitorIDHeader, labelVisitorIDHeader), labelledDF, labelVisitorIDHeader)
      exportReportDF(joinedBasicDF, s"$typ/$report")
    }

    joinAndExport(trainDF, "train")
    joinAndExport(validationDF, "validation")
    joinAndExport(testDF, "test")
}
